import React from "react";

function header() {
  return (
    <div class="main light">
  <div class="top half">
    <img src="https://m.media-amazon.com/images/M/MV5BMDc4MmMxODYtOTkyYS00ZmUzLWIwMWYtYTkyZmVhYzBkMjY3XkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_SX1777_CR0,0,1777,722_AL_.jpg" />
  </div>
  <div class="bottom half">
    <img src="https://m.media-amazon.com/images/M/MV5BMDc4MmMxODYtOTkyYS00ZmUzLWIwMWYtYTkyZmVhYzBkMjY3XkEyXkFqcGdeQXVyNjUwNzk3NDc@._V1_SX1777_CR0,0,1777,722_AL_.jpg" />
  </div>
  <button class="super-button">Enter</button>
  <div class="overlay"></div>
  <div class="button-line left">
    <div class="inner"></div>
  </div>
  <div class="button-line right">
    <div class="inner"></div>
  </div>
</div>
  );
}
